import React from 'react';
import './Header.css';

function Header(props) {
  return (
    <div className="App">
      <header>
        <div className="header">

          <ul className="headerList">            
            <li>
              <form onSubmit={props.getLocation}>                
                <input type="text" id="search_input" placeholder="Search for a city" aria-label="type a city to get weather and latest news"></input>
                <button id="search_button" type="submit"><i class="fas 2x fa-search"></i></button>
              </form>
            </li>
          </ul>
        </div>
      </header>
    </div>
  );
}

export default Header;
